import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

const Header = () => {
    return (

        <Router>
            <div className="header">
                <Link className="clover-light" to="/all-plants"><h1>Planty</h1></Link>
                <h2>Find the <span className="header-emphasis">perfect</span> plant for <span className="header-emphasis">your interior</span>.</h2>
                <Switch>
                    <Route path="/:id" component={this.Child} />
                </Switch>
            </div>
        </Router>

    );
}

export default Header;
